//componenets
import Logo from "../components/Logo";

const LoginSign = () => {
  return (
    <div id="loginSign">
      <div id="loginContainer">
        <Logo size="40px" />
        <h1>Log In</h1>
      </div>
    </div>
  );
};

export default LoginSign;
